Information
------------------------------

Lava Land: Glowing Hawaii
Hawaii, with its tropical rainforests and diverse coral reef is a spectacular natural paradise for travellers, surfers and all fans of breathtaking sandy beaches and lush green mountains. But life on the American island chain also has a dangerous side: permanently active volcanoes, lava caves, and even burning lava pours into the sea! Here you can see black smoke rise up, spray the red-hot magma into the sky and feel how the earth trembles. Located on the Pacific plate is unusual for volcanoes, Hawaii is thus researchers a fascinating destination. At Kilauea, the most active volcano on earth, the inhabitants have to live in constant danger found over the centuries cope. Lava Land - Glowing Hawaii takes you into the world of researchers and residents on the Big Iceland, the largest island of Hawaii. Exciting interviews with volcano experts and the population of this multi-faceted U.S. state as well as unique Movies can this documentation be an impressive and fascinating portrait of this beautiful and dangerous islands in the Pacific.

